export default class Test5 extends Component {
    constructor(props) {
        super(props); // Appelle le constructeur de la classe parente (Component)
        this.state = {
            counter: 1,
            date: undefined
        };
    }

    render() {
        return (
            <div>
                Hi everyone, counter: {this.state.counter}
            </div>
        );
    }
}
